import React, {useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';
import { MovieDto } from './model';
import axios from "axios";
import {Table} from 'react-bootstrap';

function App() {

  const [movies, setmovies] = useState<MovieDto[]>([])
  const URL: string = "http://localhost:8080/app/movies";

  useEffect(() => {
    axios.get(URL).then(res =>{
      setmovies(res.data.content);
    })
  }, [])


  return (
    <div>
    <Table striped>
      <thead>
        <tr>
          <th>Title</th>
          <th>Date</th>
          <th>Rating</th>
          <th>Revenue</th>
        </tr>
      </thead>
      <tbody>
        {movies.map((movie) =>(
          <tr key={movie.id}>
            <th>{movie.title}</th>
            <th>{movie.date}</th>
            <th>{movie.rating}</th>
            <th>{movie.revenue}</th>
          </tr>
        )
        )}
      </tbody>
    </Table>
    </div>
  );
}

export default App;
